import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <h1>Plant Shop</h1>
      <nav>
        <Link to="/">Home</Link>
        
        <Link to="/cart">Cart</Link>
      </nav>
      <div>
        <span>0</span> {/* Cart item count */}
      </div>
    </header>
  );
};

export default Header;
